    public string Content { get; set; }
    public DateTime CreatedAt { get; set; }
    public Guid AuthorId { get; set; }

    public BlogPost(Guid id, string title, string content, DateTime createdAt, Guid authorId)
    {
        Id = id;
        Title = title;
        Content = content;
        CreatedAt = createdAt;
        AuthorId = authorId;
    }
}

public class User
{
